import React, { useState, useEffect } from 'react';
import data from '../data/data.json'; // Supondo que você tenha os dados em JSON

const Dashboard = () => {
  const [filteredData, setFilteredData] = useState([]);
  const [filters, setFilters] = useState({
    clientCode: '',
    rca: '',
    startDate: '',
    endDate: '',
    segment: '',
    department: '',
    productCode: '',
    supervisor: ''
  });

  useEffect(() => {
    // Filtra os dados com base nos filtros
    const results = data.filter(item => {
      // Lógica para filtrar os dados
      return true; // Troque esta linha pela lógica real
    });
    setFilteredData(results);
  }, [filters]);

  return (
    <div>
      <h1>Visão Geral</h1>
      {/* Aqui você adicionaria comparações de faturamento total, etc. */}
      <div>
        {/* Adicione filtros aqui */}
      </div>
      <table>
        <thead>
          <tr>
            <th>CNPJ</th>
            <th>Cód Cliente</th>
            <th>Nome Fantasia</th>
            <th>Razão Social</th>
            <th>Bairro</th>
            <th>Município</th>
            <th>Cód Produto</th>
            <th>Produto</th>
            <th>Embalagem</th>
            <th>QT</th>
            <th>Total</th>
            <th>RCA</th>
            <th>Nome Vendedor</th>
            <th>Nome Supervisor</th>
            <th>Cód Dept</th>
            <th>Departamento</th>
            <th>Cond Venda</th>
            <th>DT FAT</th>
            <th>Segmento</th>
          </tr>
        </thead>
        <tbody>
          {filteredData.map((item, index) => (
            <tr key={index}>
              <td>{item.CNPJ}</td>
              <td>{item.COD_CLIENTE}</td>
              <td>{item.NOME_FANTASIA}</td>
              <td>{item.RAZAO_SOCIAL}</td>
              <td>{item.BAIRRO}</td>
              <td>{item.MUNICIPIO}</td>
              <td>{item.COD_PROD}</td>
              <td>{item.PRODUTO}</td>
              <td>{item.EMBALAGEM}</td>
              <td>{item.QT}</td>
              <td>{item.TOTAL}</td>
              <td>{item.RCA}</td>
              <td>{item.NOME_VENDEDOR}</td>
              <td>{item.NOME_SUPERVISOR}</td>
              <td>{item.COD_DEPTO}</td>
              <td>{item.DEPARTAMENTO}</td>
              <td>{item.COND_VENDA}</td>
              <td>{item.DT_FAT}</td>
              <td>{item.SEGMENTO}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
